import React from 'react'
import Theme from './Theme'

const Home = () => {
  return (
    <>
      <nav className="h-16 bg-purple-500 px-8 flex justify-between items-center">
        <h1>Welcome</h1>
        <Theme/>
      </nav>
    </>
  )
}

export default Home
